import React from "react";
import { Nav, Navbar} from "react-bootstrap";

function NavBar () {
    
    return (
        <>
            <Navbar bg="dark" variant="dark" expand="lg">
                <Navbar.Brand className="color-nav p-3">Desafio MM</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                        <Nav.Link href="/">Início</Nav.Link>
                        <Nav.Link href="/people">Pessoas</Nav.Link>
                        {}
                    </Nav>
                    {/* <div className="w-100">
                        <Navbar.Text style={{marginLeft:'75%', color: 'white'}}>
                            Loja: <strong>{localStorage.getItem('storeName')}</strong>
                        </Navbar.Text>
                        <Navbar.Text style={{marginLeft:'0%', color: 'white'}}>
                            &nbsp; &nbsp; &nbsp;
                            <a type="button"><strong>Sair</strong></a>
                        </Navbar.Text>
                    </div> */}
                </Navbar.Collapse>
            </Navbar>
        </>
    );
    
}
 
export default NavBar;
